import react from 'react';
import '../css/Service.css';


function Service(){
  return (
    <react.Fragment>
      <div className="service" idName="service">
        <h1>Service</h1>
      </div>

      <div className="con-service">
        <div className="itm-service left">
          App Development
        </div>
        <div className="itm-service right">
          Web Development
        </div>
      </div>
    </react.Fragment>
  );
}

export default Service;
